버섯 or 만악의 근원 or 꾹..희. or 마법의 소매.......

@youkju0412

@chock_bird ㅋㅋㅋㅋㅋㅋㅋㅋ 마법의 버섯 꼬치랑 버터비어! 
린 역시 마법부 들어가려나요 비싱은 선생님이겟지 

잔루.... 잔루는 말하는 마법의 빗자루 (ㅈㄴ

@yemae_ ㅋㅋㅋㅋㅋㅋㅋㅋㅋ
세상에
뭘 해도 버섯이 자라는 마법의 공간인가요?

@kilisama_marisa 다시 구워서 가지고 오긴 귀찮은 걸? 

(구운 버섯을 접시에 담곤)

마법의 숲... 거기서 따온 거려나? 이상한 버섯이 아니라 다행이네. 그럼 먹어볼까!

@En_0660 마법판타지 잔뜩들어간것두 좋은데 이런 현실적인 썰두 넘 맛있는거 있죠
용병생활 오래하면서 야생에서 먹을수 있는 버섯두 곧장 찾아내는 모닝이 상상하기
마법이 있어두 그걸 사용하는 사람들은 소수 일테니 먼곳을 여행하면서 다양한 곳의 음식을 먹어보는것두 거점을 두지 않는

@magus_of_night ...으응?

(아무래도 서로가 알고 있는 '마법'에 대해 뭔가 알 수 없는 괴리감과 분위기가 느껴졌지만, 그걸 계속해서 물어보면 상대의 기분이 나빠질 것 같았기에 다른 주제로 이야기를 하려 했지.)

ㄱ, 그러고 보니 아까 전에 말했던 버섯 말인데요...!

&gt;

@Kaiser_of_Death ...그래서, 여긴 무슨 용무로 들어온건데? 여기에 있는 것이라고 해봐야, 마법에 쓸 버섯 정도 밖에는 그리 가치있는 것도 없다고?

(마법사는 그 잠시동안의 섬뜩함도 금방 이겨내고서는 당당히 당신에게 말을 걸었다.)

그걸 떠나서말야. 이런 곳에 지낼 것 같아보이지는 않는데 말야.

&gt;

@Kaiser_of_Death (마법의 숲 상공, 이곳은 낮에도 해가 제대로 들지 않아 양지가 많지 않아 갖가지 버섯이 과하게 자라는 숲이었다. 그만큼이나 독성이 강한 곳이라는 의미였지.)

(그리고 이곳은 현재 어느 마법사가 비행하는 곳임과 동시에, 당신이 거닐고 있는 숲이기도 한 곳이었다.)

